import React from 'react';

class UserList extends React.Component {
  state = { hidden: true };

  handleToggle() {
    this.setState({ hidden: !this.state.hidden });
  }

  render() {
    console.log('Userslist', this.props);

    const { fullName, UserList, email, accessType } = this.props;
    return (
      <div>
        <h1>{this.props.user.length}</h1>
        <h2>Show a list of users</h2>
        <p onClick={() => this.handleToggle()}>
          {fullName} {UserList}
        </p>
        <div className={this.state.hidden ? 'hidden' : ''}>
          <p>
            {email} {accessType}
          </p>
          <button onClick={this.props.delete}>Delete User</button>
        </div>
      </div>
    );
  }
}

export default UserList;

